import SignIn from "./Component/SignIn"

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {mode: "login"}
    this.alertF = this.alertF.bind(this);
  }
  alertF(){
    alert("hung dep chai");
  }
  render() {
    if (this.state.mode === "login") {
      return <SignIn action={this.alertF}/>

    }
  }
}
